import i18n, { init } from "i18next";
import { useTranslation, initReactI18next, Translation } from "react-i18next";
import En from "./En.json"
import He from "./He.json"

const resources={
    He:{translation:{
      "Sign In" : "התחבר" ,
      "Sign Up" : "הירשם",
      "En" : "אנ",
      "He" : "עב",
      "Email":"אימייל",
      "First Name":"שם פרטי",
      "Last Name":"שם משפחה",
      "Password":"סיסמה",
      "DontAcc":"יש לך חשבון?  ",
      "forg":"שכחת סיסמה?",
      "terms":"תנאי השימוש ומדיניות הפרטיות שלנו"
    }},
    En:{translation:{
      "Sign In" : "Sign In" ,
      "Sign Up" : "Sign Up" ,
      "En" : "En",
      "He" : "He",
      "Email":"Email",
      "First Name":"First Name",
      "Last Name":"Last Name",
      "Password":"Password",
      "DontAcc":"Don't Have an Account? ",
      "forg":"Forgot Password?",
      "terms":"Our Terms of Use and Privacy Policy"
    }},
};

i18n
  .use(initReactI18next) // passes i18n down to react-i18next
  .init({
    resources,
    lng: "En",
    fallbackLng: "En",
    interpolation: {
      escapeValue: false
    }
  });

  export default i18n;
